import './App.css';
import { PowerBIEmbed } from 'powerbi-client-react';
import { models } from 'powerbi-client';
import './analysis.css'

function AttritionPage() {
  return (
    <div className="App">
      <header className="App-header">
        <PowerBIEmbed
          embedConfig={{
            type: 'report',   // Supported types: report, dashboard, tile, visual and qna
            id: 'aaf28033-0d75-4e35-8fa6-b0e7df06bf2d',
            embedUrl: "https://app.powerbi.com/reportEmbed?reportId=aaf28033-0d75-4e35-8fa6-b0e7df06bf2d&groupId=4654e0ea-55f4-48f1-8198-bcf791dcec54&w=2&config=eyJjbHVzdGVyVXJsIjoiaHR0cHM6Ly9XQUJJLUlORElBLUNFTlRSQUwtQS1QUklNQVJZLXJlZGlyZWN0LmFuYWx5c2lzLndpbmRvd3MubmV0IiwiZW1iZWRGZWF0dXJlcyI6eyJtb2Rlcm5FbWJlZCI6dHJ1ZSwidXNhZ2VNZXRyaWNzVk5leHQiOnRydWV9fQ%3d%3d",
            accessToken: 'eyJ0eXAiOiJKV1QiLCJhbGciOiJSUzI1NiIsIng1dCI6Ii1LSTNROW5OUjdiUm9meG1lWm9YcWJIWkdldyIsImtpZCI6Ii1LSTNROW5OUjdiUm9meG1lWm9YcWJIWkdldyJ9..LnYwfM8daxXWKs2j4nuBcrzaClbqIxnE8EEg7aX_LNfn8Xm2hIT7tLd0I5um17_ivSSApfHIXpkF6d5EzrGb0pfjzTxsrZ7A0zCFOg_ZbB4EZPBucilxymHcGIIKimZrG7SLK0p6MS8zoqHBOhxozGlxzXLFxZ5-kF4O_pgv307AzW00PYqDIuP2-aK-nzeCO-eolnclwAU4mQ4lqNvBNaOxM0rnZhw91uSPrFy7xLFwHGriQ7pgypEL4AyaAXLXv4Vy2mAvahKautNJ4aYXcclL-5qZiylTzJnWWUQ2Y9_at51hJyddLwb21EOFstvL5aVgVOEZXcIWlFsomYRxgg',
            tokenType: models.TokenType.Aad,
            settings: {
              panes: {
                filters: {
                  expanded: false,
                  visible: true
                }
              },
            }
          }}

          eventHandlers={
            new Map([
              ['loaded', function () { console.log('Report loaded'); }],
              ['rendered', function () { console.log('Report rendered'); }],
              ['error', function (event) { console.log(event.detail); }]
            ])
          }

          cssClassName={"Embed-container"}

          getEmbeddedComponent={(embeddedReport) => {
            window.Report = embeddedReport;
          }}
        />
      </header>
    </div>
  );
}

export default AttritionPage;
